drop database if exists farma;
create database farma character set utf8 collate utf8_croatian_ci;
use farma;

ALTER DATABASE CHARACTER SET utf8 COLLATE utf8_unicode_ci;

create table registracija(
sifra 		int 			not null primary key auto_increment,
podaci text	 	not null
);

create table operater(
sifra 		int 			not null primary key auto_increment,
lozinka	 	char(32)	 	not null,
uloga		varchar(50)		not null,
vlasnik int not null
);

create table kultura(
sifra int not null primary key auto_increment,
nazivkulture varchar(30) not null,
opis varchar(100) ,
marka varchar(30) not null
);

create table kulturaugodini(
kultura int not null,
polje int not null
);

create table polje(
sifra int not null primary key auto_increment,
nazivpolja varchar(30) not null,
velicinapolja decimal (15,2) not null,
koordinate varchar(50) ,
godinakulture datetime not null,
vlasnik int not null
);

create table zivotinje(
sifra int not null primary key auto_increment,
vrsta varchar(30) not null,
imezivotinje varchar(30) not null,
brojmarkice varchar(20) not null,
datumrodenja datetime ,
kilaza decimal(18,2) ,
cijena decimal (15,2) ,
zgrada int not null
);

create table stroj(
sifra int not null primary key auto_increment,
nazivstroja varchar(50) not null,
opis varchar(100) ,
datumkupovine datetime ,
datumservisa datetime ,
vrijednost decimal(18,2) ,
zgrada int not null
);

create table zgrada(
sifra int not null primary key auto_increment,
nazivzgrade varchar(30) not null,
opis varchar(100) ,
velicina decimal (15,2) not null,
vlasnik int not null
);

create table vlasnik(
sifra int not null primary key auto_increment,
ime varchar(30) not null,
prezime varchar(50) not null,
nazivgospodarstva varchar(100) not null,
oibgospodarstva varchar(11) not null,
brojzgrada int ,
email varchar(100) not null,
lozinka varchar(32) not null
);

alter table kulturaugodini add foreign key (polje) references polje(sifra);
alter table kulturaugodini add foreign key (kultura) references kultura(sifra);
alter table zivotinje add foreign key (zgrada) references zgrada(sifra);
alter table stroj add foreign key(zgrada) references zgrada(sifra);
alter table zgrada add foreign key(vlasnik) references vlasnik(sifra);
alter table polje add foreign key (vlasnik) references vlasnik(sifra);
alter table operater add foreign key (vlasnik) references vlasnik(sifra);


